4b7214f3-b195-5bc3-b500-b5dec21447e1=In a life filled with hospital visits, medical treatments and uncertainty, dreams can seem unattainable. Make-A-Wish\u00ae knows that a wish experience can be a game-changer for a child with a life-threatening medical condition. Wear this design and know that your purchase will help enrich a child\u2019s experience with hope, strength, and joy. Support this incredible cause with each purchase\!
ed104942-0b21-527d-9de7-c4492e56b878=Shipping & Returns
e5621679-9acb-586b-bfcf-8c251bdf3f52=We're committed to getting your order to you as soon as possible (because we know how much you want it\!). As soon as you place your order, we go to work to make that happen. Give us 1 day to process your specific order (we design everything just for you) and 1 day to make your product, and 1 day to package it up with love and send it on its journey to you. We'll be very excited at that point, and will send you an email with a link to track your order. We call it our \u201c1-2-3 policy.\u201d
a82b4a0a-d996-5280-9173-42eef1810dae=How Does Sevenly Handle Returns?
f3de6efb-8acd-5748-b95c-b4414ebc2b9b=We understand that ordering online can be difficult\! If your clothing item doesn\u2019t fit, please send it back to us within 60 days of purchase and if we have the size you need available, we will send it to you at no additional cost to you. If we do not have the size available, we would be more than happy to give you the full amount back in store credit minus the $7 donation associated with the order (This will have already been donated to the charity).
