17b000c1-7bf0-5169-903e-fd164bfd8077=When developing user interfaces in Mendix you always start by selecting a Navigation Layout for your new page. Navigation Layouts control how you navigate through your app, with top-bar or side-bar, main and sub menus. A set of navigation layouts for each device type (phone, tablet or desktop) comes bundled with the theme.
